    false,nt"url": null,nt"notes": "This narrative report for Crescent Lake
    National Wildlife Refuge outlines Refuge accomplishments from May through August
    of 1949. The report begins by summarizing the weather conditions and food and cover
    during this period. Wildlife- including migratory birds, upland game birds, big
    game animals, furbearers, predators, rodents, and raptors- is also covered. The
    Refuge development and maintenance section discusses physical developments and plantings.
    Resource management is outlined; topics include grazing and haying. A progress report
    on field investigations and applied research is also provided. The public relations
    section of the report describes recreational uses and Refuge visitors.  Short narrative
    reports of North Platte National Wildlife Refuge and Box Butte National Wildlife
    Refuge are attached, as well as some N-R forms.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
